import React from "react";
import ReactDOM  from "react-dom";
import sum,{Sub,Div,Mult} from "./App";

ReactDOM.render(
  <>
   <ol>
    <li>{sum(40,3)}</li>
    <li>{Sub(30,3)}</li>
    <li>{Div(10,3)}</li>
    <li>{Mult()}</li>
   </ol>
  </>
  ,document.getElementById('root')
);
